Un grupo de jugadores del baloncesto venezolano fijaron posición sobre la actual situación país. En la cuenta de la periodista Meche Celta apareció colgado este material, y el siguiente texto:
-
Pueden hacer el intento de tapar el sol con un dedo, pero no podrán callar nunca a millones de venezolanos que exigimos un mejor país. BASTA de asesinatos, BASTA de injusticia, BASTA de represión. 🏀 Comparto el mensaje de los protagonistas de la historia deportiva de Venezuela. Ellos, también dicen BASTA YA!! Los jugadores de baloncesto de Venezuela levantan su voz!! Producción audiovisual:
